“Menteri”  ertinya  Menteri  yang  dipertanggungkan  dengan 
tanggungjawab  dalam  hal  yang  berhubungan  dengan  Lembaga 
Kumpulan Wang Simpanan Pekerja;

“orang  yang  bekerja  sendiri”  ertinya  mana-mana  orang  yang 
melakukan sesuatu pekerjaan yang mendatangkan hasil dan bukannya 
seorang pekerja;

“pinjaman  perumahan  khas”  ertinya  apa-apa  pinjaman  kepada 
syarikat  yang diluluskan semata-mata bagi maksud pinjaman semula 
kepada peminjam bagi pembelian rumah kos rendah;

(c)  diluluskan  oleh  Menteri  melalui  pemberitahuan  dalam 
Warta  bagi  maksud  menerima  pinjaman  daripada 
Lembaga mengikut seksyen 26A;

Pengerusi,  atau  mana-mana  orang  lain  yang  dilantik 
oleh Menteri, yang hendaklah menjadi Pengerusi Panel 
Pelaburan;

seseorang yang telah disabitkan atas suatu kesalahan dan 
dihukum  dengan  pemenjaraan  bagi  suatu  tempoh  yang 
tidak kurang daripada satu tahun;

(b)  wang  yang  diperoleh  dengan  menjalankan  apa-apa 
projek,  skim  atau  perusahaan  yang  dibiayai  daripada 
Kumpulan Wang;

“debentur”  termasuklah  stok  debentur,  bon,  nota  dan  mana-mana 
sekuriti lain sesebuah perbadanan sama ada membentuk suatu gadaian 
ke atas aset perbadanan atau tidak;

Dengan  syarat  bahawa  Menteri  boleh  mengubah 
apa-apa  had  yang  dikenakan  ke  atas  jumlah  amaun 
pinjaman syarikat diluluskan dalam perenggan ini;

(b)  bertanggungjawab atau telah bertanggungjawab bagi apa-
apa kekurangan dalam, atau bagi kemusnahan pada, apa-
apa wang, setem, sekuriti, stor atau harta lain Lembaga;

yang 
menjalankan  kuasanya  di  bawah  seksyen  35,  akses 
kepada mana-mana premis atau bahagiannya;

(b)  menyerang, menghalang, menggalang atau melengahkan 
Pemeriksa itu dalam melakukan apa-apa kemasukan yang 
dia berhak untuk melakukan;

(c)  gagal  mematuhi  apa-apa  kehendak  sah  Pemeriksa 
dalam  melaksanakan  kuasa,  fungsi  dan  tugasnya  di 
bawah seksyen 35;

(a)  amaun  apa-apa  caruman  yang  dibayar  berkenaan 
dengannya oleh majikan bagi pihaknya sendiri dan bagi 
pihak ahli tersebut dalam Kumpulan Wang;

(c)  ahli Kumpulan Wang itu telah membeli atau membina rumah 
dan telah mengambil pinjaman di bawah perenggan 26(1)(f) 
untuk pembelian atau pembinaan rumah itu;

(f)  ahli  Kumpulan  Wang  itu  atau  mana-mana  orang  lain  yang 
diluluskan  oleh  Lembaga  memerlukan  pembiayaan 
perubatan;

(h)  untuk  menetapkan  fi  yang  hendaklah  dibayar  kepada 
Lembaga  berkenaan  dengan  pelaburan  di  bawah  Bahagian 
IIIA dan caj bagi maksud menjalankan peruntukan Akta ini;

(i)  untuk  menetapkan  fi  untuk  dikenakan  ke  atas  institusi 
pengurusan dana atau institusi lain yang diluluskan di bawah 
Bahagian IIIA;

(ka)  untuk menetapkan apa-apa caj atau fi yang hendaklah dibayar 
kepada Lembaga bagi maksud menjalankan peruntukan Akta 
ini;

(a)  untuk  mengadakan  peruntukan  bagi  pembayaran  segala 
caruman di bawah Akta ini atau mana-mana bahagiannya, 
yang tertinggal daripada dibayar;

(c)  untuk  menetapkan  penyata  yang  hendaklah  dibuat  oleh 
majikan, dan borang dan daftar yang hendaklah digunakan, 
dalam melaksanakan mana-mana peruntukan Akta ini;

(d)  untuk menetapkan tatacara yang hendaklah diikuti apabila 
caruman  didepositkan  oleh  majikan  dalam  Kumpulan 
Wang;

(f)  untuk  mengadakan  peruntukan  bagi  mengembalikan 
caruman,  atau  mana-mana  bahagian  caruman  itu,  yang 
tersilap dibayar;

(g)  untuk  menetapkan  tatacara  yang  hendaklah  diikuti  bagi 
maksud penamaan dan pembatalan penamaan, dan butir-
butir yang hendaklah dikemukakan;

(i)  untuk  mengadakan  peruntukan  bagi  pelantikan  lembaga 
perubatan  bagi  maksud  perenggan  54(1)(c)  dan  bagi  
apa-apa maksud lain sebagaimana yang ditetapkan;

(k)  untuk mengadakan peruntukan bagi pelupusan amaun yang 
tidak  dituntut,  tidak  dibayar  atau  selainnya  masih  berada 
dalam Kumpulan Wang;

(l)  untuk  menetapkan  tatacara  yang  hendaklah  diikuti  bagi 
pelupusan  perkara  yang  berhubungan  dengan  akaun 
majikan dan pekerja;

(n)  untuk  menetapkan  apa-apa  yang  berhubungan  dengan 
pelaburan  di  bawah  Bahagian  IIIA termasuk  tatacara  bagi 
pelaburan;

(na)  untuk  menetapkan  apa-apa  perkara  yang  berhubungan 
dengan pemindahan kredit di bawah Bahagian VA termasuk 
pengeluaran bagi kredit yang dipindahkan;

(a)  Akta  Kumpulan  Wang  Simpanan  Pekerja  1951  
[Akta  272]  (dalam  Bahagian  ini  disebut  sebagai  “Akta 
yang dimansuhkan”) hendaklah terhenti berkuat kuasa;

(a) pembubaran perkahwinan antara ahli Kumpulan Wang yang memilih untuk 
memindahkan  carumannya  dengan  ahli  Kumpulan  Wang  yang  menerima 
